import React from 'react';
import { Link } from 'react-router-dom';
import { Heart, Stethoscope } from 'lucide-react';

const Header = () => {
  return (
    <header style={{
      backgroundColor: '#ffffff',
      borderBottom: '1px solid #e5e7eb',
      padding: '16px 0',
      boxShadow: '0 1px 3px 0 rgba(0, 0, 0, 0.1)'
    }}>
      <div className="container">
        <div className="flex items-center justify-between">
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
            <div className="flex items-center gap-3">
              <div style={{
                backgroundColor: '#3b82f6',
                borderRadius: '8px',
                padding: '8px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
              }}>
                <Heart size={24} color="white" />
              </div>
              <div>
                <h1 style={{
                  fontSize: '1.5rem',
                  fontWeight: '700',
                  color: '#1e293b',
                  margin: '0'
                }}>
                  HealthCare
                </h1>
                <p style={{
                  fontSize: '0.875rem',
                  color: '#64748b',
                  margin: '0'
                }}>
                  Appointment Booking
                </p>
              </div>
            </div>
          </Link>
          
          <nav>
            <ul style={{
              display: 'flex',
              listStyle: 'none',
              gap: '24px',
              margin: '0',
              padding: '0'
            }}>
              <li>
                <Link 
                  to="/" 
                  style={{
                    textDecoration: 'none',
                    color: '#374151',
                    fontWeight: '500',
                    display: 'flex',
                    alignItems: 'center',
                    gap: '8px'
                  }}
                >
                  <Stethoscope size={16} />
                  Find Doctors
                </Link>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    </header>
  );
};

export default Header;
